import React from 'react';

import '../../styles/components/video/_video-list.scss';

export default function VideoList({ loadNewVideo }) {


		const { videos, load } = this.props;

		return (
			<div className='video-list__wrapper'>
				<div className="video-list">
					{
						videos.map((video) => (
							<div key={video.id.videoId} className="video-list__item" onClick={() => loadNewVideo()}>
								{console.log(video)}
								<img src={video.snippet.thumbnails.high.url} />
								<h4><span dangerouslySetInnerHTML={{__html: decodeURI(video.snippet.title) }} /></h4>
							</div>
						))
					}
				</div>
			</div>
		)

}
